import React from 'react';
import {data} from '../utils/data';


const datalist = data.map(dat =>
    <BurgerIngredients name = {dat.name}/>
)
export default function BurgerIngredients ({datas}) {

    const image = (
        <img
          src={
            data.image
          }
        />
      );
      return (
        <div>
          <div className={'img'}>{image}</div>
          <p className={'name'}>{data.name}</p>
          <p className={'description'}>{`${data.fat}`}</p>
          <p className={'description'}>{`${data.price}`}</p>
        </div>
      );
    };
